import React from 'react';
import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import UploadPage from './pages/UploadPage';
import ImagesPage from './pages/ImagesPage';
import ImagesAnnotationPage from './pages/ImagesAnnotationPage';
import Nopage from './pages/Nopage';

function App() {
  return (
    <div>
    <div>
    <Header/>
    </div>
    <Router>
      <h1>Image Annotation and Measurement Application!</h1>
      <img className="logo" alt="logoImage" src="https://thenounproject.com/api/private/icons/1396339/edit/?backgroundShape=SQUARE&backgroundShapeColor=%23000000&backgroundShapeOpacity=0&exportSize=752&flipX=false&flipY=false&foregroundColor=%23000000&foregroundOpacity=1&imageFormat=png&rotation=0"/>
      <nav className="nav-container">
        <div className="nav-links">
          <Link to="/images/upload" className="nav-link">Upload Image</Link>
          <Link to="/images/view" className="nav-link">View All Images</Link>
          <Link to="/images/edit/:id" className="nav-link">Annotate Image</Link>
        </div>
      </nav>
      <Routes>
        <Route path="/" element={<UploadPage />} />
        <Route path="/images/upload" element={<UploadPage />} />
        <Route path="/images/view" element={<ImagesPage />} />
        <Route path="/images/edit/:id" element={<ImagesAnnotationPage />} />
        <Route path="*" element={<Nopage />} />
      </Routes>
    </Router>
     <div>
        <Footer className="footer" />
      </div>
    </div>
  );
}

export default App;
